// Index IATA pour accès O(1)
// eslint-disable-next-line no-unused-vars
const AIRPORTS_MAP = {};
AIRPORTS.forEach(a => { AIRPORTS_MAP[a.iata] = a; });

/**
 * Recherche d'aéroports — normalise les accents, retourne max 10 résultats.
 * @param {string} query
 * @returns {Array}
 */
// eslint-disable-next-line no-unused-vars
function searchAirports(query) {
  if (!query || query.length < 2) return [];
  function norm(s) {
    return s.normalize('NFD').replace(/[\u0300-\u036f]/g, '').toLowerCase();
  }
  const q    = norm(query);
  const qUp  = query.toUpperCase();
  const results = [];
  for (const a of AIRPORTS) {
    if (results.length >= 10) break;
    if (a.iata === qUp) { results.unshift(a); continue; }
    if (norm(a.city).startsWith(q))    { results.push(a); continue; }
    if (norm(a.name).includes(q))      { results.push(a); continue; }
    if (norm(a.country).startsWith(q)) { results.push(a); continue; }
  }
  return results.slice(0, 10);
}

/**
 * Distance orthodromique (Haversine) en km.
 */
// eslint-disable-next-line no-unused-vars
function haversineDistance(lat1, lon1, lat2, lon2) {
  const R  = 6371;
  const dL = (lat2 - lat1) * Math.PI / 180;
  const dl = (lon2 - lon1) * Math.PI / 180;
  const a  = Math.sin(dL/2)**2 +
             Math.cos(lat1 * Math.PI/180) * Math.cos(lat2 * Math.PI/180) *
             Math.sin(dl/2)**2;
  return R * 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
}
